import styles from "./styles.scss";

export default function Logo() {
  return (
    <div className={styles.Logo}>
      <img className={styles.logo} src="/svg/logo.svg" />
      <h1>
        <span className={styles.travel}>travel</span>
        <span className={styles.bug}>bug</span>
      </h1>
    </div>
  );
}
